import styled from "styled-components";

import Header from "../Header";

const StyledOnline = styled.div`
  width: 100%;
  height: 400px;
`;

const Heading = styled.p`
  font-size: 16px;
  font-weight: 700;

  color: #42ff00;
`;

const Online = ({}) => {
  return (
    <StyledOnline>
      <Header>
        <p
          style={{
            width: "100%",
            fontSize: "16px",
            fontWeight: 700,
            letterSpacing: "2px",
            textAlign: "center",
          }}
        >
          ONLINE (7)
        </p>
      </Header>
      <div style={{width: "80"}} >
        <Heading>Lobby (5)</Heading>
      </div>
    </StyledOnline>
  );
};

export default Online;
